import React, { useState, useEffect } from 'react';
import { updateProfile, getProfile } from './api';

const UpdateProfile = ({ userId, token }) => {
    const [profileData, setProfileData] = useState({
        name: '',
        degree: '',
        experience: 0,
        top_expertise: '',
        phone_number: '',
        email: '',
        description: '',
        city: '',
        address: '',
        hospital: '',
        fees: '',
        available_days: '',
        available_timings: ''
    });

    useEffect(() => {
        async function fetchProfile() {
            const data = await getProfile(userId, token);
            setProfileData(data);
        }
        fetchProfile();
    }, [userId, token]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setProfileData(prevData => ({
            ...prevData,
            [name]: value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const updatedData = await updateProfile(userId, token, profileData);
            alert('Profile updated successfully!');
            console.log('Updated Profile:', updatedData);
        } catch (error) {
            console.error('Failed to update profile:', error);
            alert('Error updating profile.');
        }
    };

    return (
        <form onSubmit={handleSubmit} className="update-profile-form">
            <h2>Update Profile</h2>
            <label>
                Name:
                <input type="text" name="name" value={profileData.name} onChange={handleChange} />
            </label>
            <label>
                Degree:
                <input type="text" name="degree" value={profileData.degree} onChange={handleChange} />
            </label>
            <label>
                Experience:
                <input type="number" name="experience" value={profileData.experience} onChange={handleChange} />
            </label>
            <label>
                Expertise:
                <input type="text" name="top_expertise" value={profileData.top_expertise} onChange={handleChange} />
            </label>
            <label>
                Phone:
                <input type="text" name="phone_number" value={profileData.phone_number} onChange={handleChange} />
            </label>
            <label>
                Email:
                <input type="email" name="email" value={profileData.email} onChange={handleChange} />
            </label>
            <label>
                Description:
                <textarea name="description" value={profileData.description} onChange={handleChange}></textarea>
            </label>
            <label>
                City:
                <input type="text" name="city" value={profileData.city} onChange={handleChange} />
            </label>
            <label>
                Address:
                <input type="text" name="address" value={profileData.address} onChange={handleChange} />
            </label>
            <label>
                Hospital:
                <input type="text" name="hospital" value={profileData.hospital} onChange={handleChange} />
            </label>
            <label>
                Fees:
                <input type="number" name="fees" value={profileData.fees} onChange={handleChange} />
            </label>
            <label>
                Available Days:
                <input type="text" name="available_days" value={profileData.available_days} onChange={handleChange} />
            </label>
            <label>
                Available Timings:
                <input type="text" name="available_timings" value={profileData.available_timings} onChange={handleChange} />
            </label>
            <button type="submit" className="profile-button">Update Profile</button>
        </form>
    );
};

export default UpdateProfile;
